import "./Header.scss";
import { Container, Navbar } from "react-bootstrap";

function Header() {
  return (
    <div className="header">
      <Container>
        <Navbar expand="lg" variant="light" bg="light">
          <Container>
            <Navbar.Brand href="#">Bob Kyeyune</Navbar.Brand>
          </Container>
        </Navbar>
      </Container>
    </div>
  );
}

export default Header;
